    false,nt"url": null,nt"notes": "Sandhill cranes have been recorded on Alaska
    breeding pair surveys since 1957. Observations have been expanded for area only
    providing mean indexes of 2,200 for spruce-muskeg habitat, 26,500 for tundra habitat,
    and 28,800 for Alaska. These indexes have been further expanded with postulated
    visibility correction factors for respective habitats yielding mean populations
    of 23,100 for spruce-muskeg, 98,100 for tundra, and 121,700 for Alaska. Significant
    positive correlations (r = .22, p <.01 for indexes; r 2 = .27, p (.01 for visibility
    corrected indexes) result when breeding pair survey data is compared with Nebraska
    sandhill crane spring migration counts. The value of survey results could be increased
    with additional effort. The data shows an increase in the Alaska sandhill crane
    breeding population 1957-80, a 24 year period of consistent standard aerial waterfowl
    survey effort.",nt"license_title": "License Not Specified",nt"extras":
